  return (
    <>
      <NavBar />
      <Box height={30} />
      <Box sx={{ display: "flex" }}>
        <SideNavBar />

        <Box component="main" sx={{ flexGrow: 1, p: 3 }}>
          <h1>Form</h1>

          <form>
            <input type="text" placeholder="Book's Name" />
            <input type="text" placeholder="Author's Name" />
            <input type="text" placeholder="Publisher's Name" />
            <input type="text" placeholder="Available" />
            <input type="text" placeholder="Ledger" />
            <button onClick={handleSubmit}></button>
